import React, { useState, useEffect } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./AngajatPage.css";
import navbar from "../NavbarComponent/Navbar.js";
import { Button, Modal } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import { useLocation } from "react-router-dom";

function AdminPage() {
  const location = useLocation();
  const { numeAngajat, prenumeAngajat, departamentAngajat } =
    location.state || {};
  const navigate = useNavigate();
  const [show, setShow] = useState(false);
  const [data, setData] = useState([]);
  const [showUpdateModal, setShowUpdateModal] = useState(false);

  const [updateData, setUpdateData] = useState({
    age: 0,
    sex: "",
    bmi: 0,
    children: 0,
    smoker: "",
    region: "",
    charges: 0,
  });

  const [formData, setFormData] = useState({
    age: 0,
    sex: "",
    bmi: 0,
    children: 0,
    smoker: "",
    region: "",
    charges: 0,
  });

  const handleClose = () => {
    setShow(false);
    setFormData({
      age: 0,
      sex: "",
      bmi: 0,
      children: 0,
      smoker: "",
      region: "",
      charges: 0,
    });
  };

  const [deleteCnp, setDeleteCnp] = useState(""); // CNP to delete
  const [showDeleteConfirmation, setShowDeleteConfirmation] = useState(false);
  const [searchAge, setSearchAge] = useState(""); // State variable for the search input
  const [searchSex, setSearchSex] = useState(""); // State variable for the search input

  const handleShow = () => setShow(true);

  const handleSearchAgeInputChange = (e) => {
    setSearchAge(e.target.value);
  };

  const handleSearchSexInputChange = (e) => {
    setSearchSex(e.target.value);
  };

  let filteredData = [];

  if (searchAge) {
    filteredData = data.filter((input) => {
      const inputAgeString = input.age.toString();
      const searchAgeString = searchAge.toString();
      return inputAgeString.includes(searchAgeString);
    });
  } else if (searchSex) {
    filteredData = data.filter((input) => {
      const inputSexLower = input.sex.toLowerCase();
      const searchSexLower = searchSex.toLowerCase();
      return inputSexLower === searchSexLower;
    });
  } else {
    filteredData = data;
  }

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Make a POST request to your API endpoint
    fetch("http://localhost:5036/api/DateCompleteAngajat", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(formData),
    })
      .then((response) => {
        if (response.ok) {
          // Refresh the employee list after successful POST
          fetch("http://localhost:5036/api/DateCompleteAngajat")
            .then((response) => response.json())
            .then((updatedData) => {
              setData(updatedData);
              handleClose();
            })
            .catch((error) =>
              console.error("Error fetching updated data:", error)
            );
        } else {
          // Handle errors here
        }
      })
      .catch((error) => console.error("Error making POST request:", error));
  };

  useEffect(() => {
    fetch("http://localhost:5139/api/IoTLinearRegressionApi")
      .then((response) => response.json())
      .then((data) => {
        if (data && Array.isArray(data)) {
          const firstElement = data[0];
          if (
            firstElement &&
            firstElement.inputs &&
            firstElement.inputs.input1
          ) {
            console.log("Input1 Data:", firstElement.inputs.input1);
            setData(firstElement.inputs.input1);
          } else {
            console.error(
              "Input1 is missing or undefined in the first element."
            );
            setData([]); // Initialize data to an empty array
          }
        } else {
          console.error("Data is not an array or is undefined:", data);
          setData([]); // Initialize data to an empty array
        }
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
        setData([]); // Initialize data to an empty array
      });
  }, []);

  const handleDeleteConfirmation = (cnp) => {
    setDeleteCnp(cnp);
    setShowDeleteConfirmation(true);
  };

  const handleOpenUpdateModal = (angajatData) => {
    setShowUpdateModal(true);
    setUpdateData(angajatData);
  };

  const handleDelete = () => {
    fetch(`http://localhost:5036/api/DateCompleteAngajat/${deleteCnp}`, {
      method: "DELETE",
    })
      .then((response) => {
        if (response.ok) {
          fetch("http://localhost:5036/api/DateCompleteAngajat")
            .then((response) => response.json())
            .then((updatedData) => setData(updatedData))
            .catch((error) =>
              console.error("Error fetching updated data:", error)
            );
          setShowDeleteConfirmation(false); // Close the delete confirmation modal
        } else {
          // Handle errors here
          console.error("Error deleting employee with CNP:", deleteCnp);
        }
      })
      .catch((error) => console.error("Error making DELETE request:", error));
  };

  const handleUpdate = (e) => {
    e.preventDefault();

    fetch(
      `http://localhost:5036/api/Login/UpdateDateGeneraleAngajat/${updateData.cnp}`,
      {
        method: "PUT",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(updateData),
      }
    )
      .then((response) => {
        if (response.ok) {
          fetch("http://localhost:5036/api/DateCompleteAngajat")
            .then((response) => response.json())
            .then((updatedData) => {
              setData(updatedData);
              setShowUpdateModal(false);
            })
            .catch((error) =>
              console.error("Error fetching updated data:", error)
            );
        } else {
          console.error("Error updating employee with CNP:", updateData.cnp);
        }
      })
      .catch((error) => console.error("Error making PUT request:", error));
  };

  return (
    <div>
      <nav id="navbar">
        <div className="wrapper">
          <div className="logo">
            {departamentAngajat === "Management" && (
              <a
                href="/adminHomePage"
                onClick={(e) => {
                  e.preventDefault();
                  navigate("/adminHomePage", {
                    state: {
                      numeAngajat: numeAngajat,
                      prenumeAngajat: prenumeAngajat,
                      departamentAngajat: departamentAngajat,
                    },
                  });
                }}
              >
                <img
                  src="https://logos-world.net/wp-content/uploads/2022/07/Hertz-Logo.png"
                  alt="Hertz Logo"
                  style={{ maxWidth: "100px", maxHeight: "50px" }}
                />
              </a>
            )}

            {departamentAngajat === "Contabilitate" && (
              <a
                href="/contabilitateHomePage"
                onClick={(e) => {
                  e.preventDefault();
                  navigate("/contabilitateHomePage", {
                    state: {
                      numeAngajat: numeAngajat,
                      prenumeAngajat: prenumeAngajat,
                      departamentAngajat: departamentAngajat,
                    },
                  });
                }}
              >
                <img
                  src="https://logos-world.net/wp-content/uploads/2022/07/Hertz-Logo.png"
                  alt="Hertz Logo"
                  style={{ maxWidth: "100px", maxHeight: "50px" }}
                />
              </a>
            )}
          </div>
          <span className="welcome-label">
            LinearRegression - IoT Project Frontend Example
          </span>
          <input type="radio" name="slider" id="menu-btn" />
          <input type="radio" name="slider" id="close-btn" />
          <ul className="nav-links">
            <label htmlFor="close-btn" className="btn close-btn">
              <i className="fas fa-times"></i>
            </label>
            <li>
              <a href="">Employees</a>
            </li>
            {departamentAngajat === "Management" && (
              <li>
                <a
                  href="/angajatPage"
                  onClick={(e) => {
                    e.preventDefault(); // Prevent the default link behavior
                    navigate("/stocPage", {
                      state: {
                        numeAngajat: numeAngajat,
                        prenumeAngajat: prenumeAngajat,
                        departamentAngajat: departamentAngajat,
                      },
                    });
                  }}
                >
                  Stock
                </a>
              </li>
            )}
            <input type="checkbox" id="showMega" />
            <li>
              <a
                href="/angajatPage"
                onClick={(e) => {
                  e.preventDefault(); // Prevent the default link behavior
                  navigate("/providerPage", {
                    state: {
                      numeAngajat: numeAngajat,
                      prenumeAngajat: prenumeAngajat,
                      departamentAngajat: departamentAngajat,
                    },
                  });
                }}
              >
                Providers
              </a>
            </li>
            <li>
              <a className="LogoutButton">
                <i className="fas fa-sign-out-alt"></i> Log Out
              </a>
            </li>
          </ul>
          <label htmlFor="menu-btn" className="btn menu-btn">
            <i className="fas fa-bars"></i>
          </label>
        </div>
      </nav>

      <div className="container" style={{ marginTop: "160px" }}>
        <div className="crud shadow-lg p-3 mb-5 mt-5 bg-body rounded">
          <div className="row">
            <div className="col-sm-3 mt-5 mb-4 text-gred">
              <div className="search">
                <form className="form-inline">
                  <div className="mb-2">
                    <input
                      className="form-control"
                      type="search"
                      placeholder="Age"
                      aria-label="Search"
                      value={searchAge}
                      onChange={handleSearchAgeInputChange}
                    />
                  </div>
                  <div className="mb-2">
                    <select
                      className="form-control"
                      value={searchSex}
                      onChange={handleSearchSexInputChange}
                      name="searchSex"
                    >
                      <option value="">All</option>
                      <option value="male">Male</option>
                      <option value="female">Female</option>
                    </select>
                  </div>
                </form>
              </div>
            </div>
            <div className="col-sm-3 offset-sm-2 mt-5 mb-4 text-gred">
              <h2 style={{ color: "black" }}>
                <b>Inputs</b>
              </h2>
            </div>
            <div className="col-sm-3 offset-sm-1 mt-5 mb-4 text-gred">
              <Button variant="primary" onClick={handleShow}>
                Add Inputs
              </Button>
            </div>
          </div>
          <div className="row">
            <div className="table-responsive">
              <table className="table table-striped table-hover table-bordered custom-table">
                <thead>
                  <tr>
                    <th>Age</th>
                    <th>Sex</th>
                    <th>BMI</th>
                    <th>Children</th>
                    <th>Smoker</th>
                    <th>Region</th>
                    <th>Charges</th>
                    <th>Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {filteredData.map((input, index) => (
                    <tr key={index}>
                      <td>{input.age}</td>
                      <td>{input.sex}</td>
                      <td>{input.bmi}</td>
                      <td>{input.children}</td>
                      <td>{input.smoker}</td>
                      <td>{input.region}</td>
                      <td>{input.charges}</td>
                      <td>
                        <a
                          className="edit"
                          title="Edit"
                          data-toggle="tooltip"
                          onClick={() => handleOpenUpdateModal(input)}
                        >
                          <i className="material-icons">&#xE254;</i>
                        </a>
                        <a
                          className="delete"
                          title="Delete"
                          data-toggle="tooltip"
                          onClick={() => handleDeleteConfirmation(input.sex)}
                        >
                          <i className="material-icons">&#xE872;</i>
                        </a>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>

          {/* Delete Confirmation Modal */}
          <Modal
            show={showDeleteConfirmation}
            onHide={() => setShowDeleteConfirmation(false)}
            backdrop="static"
            keyboard={false}
          >
            <Modal.Header closeButton>
              <Modal.Title>
                Are you sure you want to delete this input? The action is
                irreversible.
              </Modal.Title>
            </Modal.Header>
            <Modal.Footer>
              <Button
                variant="secondary"
                className="btn-modal"
                onClick={() => setShowDeleteConfirmation(false)}
              >
                Cancel
              </Button>
              <Button variant="danger" onClick={handleDelete}>
                Yes
              </Button>
            </Modal.Footer>
          </Modal>
        </div>

        <div>
          {/* Update Modal */}
          <Modal
            show={showUpdateModal}
            onHide={() => setShowUpdateModal(false)}
            backdrop="static"
            keyboard={false}
          >
            <Modal.Header closeButton>
              <Modal.Title>Update input data</Modal.Title>
            </Modal.Header>
            <Modal.Body>
              <form onSubmit={handleUpdate}>
                <div className="form-group">
                  <label htmlFor="age">Age:</label>
                  <input
                    type="number"
                    className="form-control"
                    id="age"
                    name="age"
                    value={updateData.age}
                    onChange={(e) =>
                      setUpdateData({ ...updateData, age: e.target.value })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="sex">Sex:</label>
                  <select
                    className="form-control"
                    id="sex"
                    name="sex"
                    value={updateData.sex}
                    onChange={(e) =>
                      setUpdateData({ ...updateData, sex: e.target.value })
                    }
                    required
                  >
                    <option value="male">Male</option>
                    <option value="female">Female</option>
                  </select>
                </div>

                <div className="form-group">
                  <label htmlFor="bmi">BMI:</label>
                  <input
                    type="bmi"
                    className="form-control"
                    id="bmi"
                    name="bmi"
                    value={updateData.bmi}
                    onChange={(e) =>
                      setUpdateData({ ...updateData, bmi: e.target.value })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="children">Children:</label>
                  <input
                    type="number"
                    className="form-control"
                    id="children"
                    name="children"
                    value={updateData.children}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        children: e.target.value,
                      })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="smoker">Smoker:</label>
                  <select
                    className="form-control"
                    id="smoker"
                    name="smoker"
                    value={updateData.smoker}
                    onChange={(e) =>
                      setUpdateData({ ...updateData, smoker: e.target.value })
                    }
                    required
                  >
                    <option value="">Yes/No</option>
                    <option value="yes">Yes</option>
                    <option value="no">No</option>
                  </select>
                </div>

                <div className="form-group">
                  <label htmlFor="region">Region:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="region"
                    name="region"
                    value={updateData.region}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        region: e.target.value,
                      })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="charges">Charges:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="charges"
                    name="charges"
                    value={updateData.charges}
                    onChange={(e) =>
                      setUpdateData({ ...updateData, charges: e.target.value })
                    }
                    required
                  />
                </div>

                <button type="submit" className="btn btn-success mt-4">
                  Update
                </button>
              </form>
            </Modal.Body>
            <Modal.Footer>
              <Button
                variant="secondary"
                onClick={() => setShowUpdateModal(false)}
              >
                Cancel
              </Button>
            </Modal.Footer>
          </Modal>
        </div>

        {/* <!-- Model Box --> */}
        <div className="model_box">
          <Modal
            show={show}
            onHide={handleClose}
            backdrop="static"
            keyboard={false}
          >
            <Modal.Header closeButton>
              <Modal.Title>Add Inputs</Modal.Title>
            </Modal.Header>
            <Modal.Body>
              <form onSubmit={handleSubmit}>
                <label htmlFor="Age">Age:</label>
                <div className="form-group">
                  <input
                    type="number"
                    className="form-control"
                    name="age"
                    value={formData.age}
                    onChange={handleChange}
                    placeholder="Age"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <label htmlFor="sex">Sex:</label>
                  <select
                    className="form-control"
                    name="sex"
                    value={formData.sex}
                    onChange={handleChange}
                    required
                  >
                    <option value="">Select Sex</option>
                    <option value="male">Male</option>
                    <option value="female">Female</option>
                  </select>
                </div>
                <div className="form-group mt-3">
                  <label htmlFor="BMI">BMI:</label>
                  <input
                    type="number"
                    className="form-control"
                    name="bmi"
                    value={formData.bmi}
                    onChange={handleChange}
                    placeholder="BMI"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <label htmlFor="Children">Children:</label>
                  <input
                    type="number"
                    className="form-control"
                    name="children"
                    value={formData.children}
                    onChange={handleChange}
                    placeholder="Children"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <label htmlFor="smoker">Smoker:</label>
                  <select
                    className="form-control"
                    name="smoker"
                    value={formData.smoker}
                    onChange={handleChange}
                    required
                  >
                    <option value="">Yes/No</option>
                    <option value="yes">Yes</option>
                    <option value="no">No</option>
                  </select>
                </div>
                <div className="form-group mt-3">
                  <label htmlFor="region">Region:</label>
                  <input
                    type="text"
                    className="form-control"
                    name="region"
                    value={formData.region}
                    onChange={handleChange}
                    placeholder="Region"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <label htmlFor="charges">Charges:</label>
                  <input
                    type="number"
                    className="form-control"
                    name="charges"
                    value={formData.charges}
                    onChange={handleChange}
                    placeholder="Charges"
                    required
                  />
                </div>
                <button type="submit" className="btn btn-success mt-4">
                  Add
                </button>
              </form>
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={handleClose}>
                Close
              </Button>
            </Modal.Footer>
          </Modal>
        </div>

        {/* <!-- Results --> */}
        <h2 style={{ color: "black" }}>
          <b>Results</b>
        </h2>
        <div className="row">
          <div className="table-responsive">
            <table className="table table-striped table-hover table-bordered custom-table">
              <thead>
                <tr>
                  <th>Age</th>
                  <th>Sex</th>
                  <th>BMI</th>
                  <th>Children</th>
                  <th>Smoker</th>
                  <th>Region</th>
                  <th>Charges</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {filteredData.map((input, index) => (
                  <tr key={index}>
                    <td>{input.age}</td>
                    <td>{input.sex}</td>
                    <td>{input.bmi}</td>
                    <td>{input.children}</td>
                    <td>{input.smoker}</td>
                    <td>{input.region}</td>
                    <td>{input.charges}</td>
                    <td>
                      <a
                        className="edit"
                        title="Edit"
                        data-toggle="tooltip"
                        onClick={() => handleOpenUpdateModal(input)}
                      >
                        <i className="material-icons">&#xE254;</i>
                      </a>
                      <a
                        className="delete"
                        title="Delete"
                        data-toggle="tooltip"
                        onClick={() => handleDeleteConfirmation(input.sex)}
                      >
                        <i className="material-icons">&#xE872;</i>
                      </a>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
}

export default AdminPage;
